#to figure out how to solve this problem i started writing the number of
#step from the beginning (maze[0][0]) to the last cell of the matrix
#after some times i realize that if i write down the number of step 
#that are the effective ones but also, for each step, i write also the 
#next step (the cells right next), the matrix shows me a pattern
#and if i do that also backwards, starting from the finishing point up to
#the cell 0,0 i would easely figure out what is the minumum number of steps
#in order to reach the exit of the matrix
#
#in order to visualize my scheme i will show you an example
# maze=[[0,0,0],
#       [1,1,0],
#       [0,0,0],
#       ]
#
#now i start counting from the top left corner
#a=[[1,0,0],
#   [0.0.0],
#   [0,0,0]
#   ]
#
#then i move one writing the next step near the first:
#a=[[1,2,0],
#   [2,0,0],
#   [0,0,0]]
#
#now for each step that i wrote, if the same cell in maze is a zero i wrote
#the next step, if it isn't i would do nothing
#a=[[1,2,3],
#   [2,3,0],
#   [0,0,0]]
#
#adn i continue in this way, at the end a would be:
#a=[[1,2,3],
#   [2,3,4],
#   [0,0,5]]
#
#doing the same thing but starting from the bottom right corner
#i would obtain:
#
#b=[[5,4,3],
#   [4,3,2],
#   [3,2,1]]
#
#now yhe only thing to do is to sum all the cell of a with all the cells of b
#(but only if thei are not zeroes, even if just one out of two is a zero)
#
#if we take the minimum value that we obtained and we subtract one
#we will have the shortest number of steps possible to solve the matrix
#
#
#my function are defined as some_name_a and some_name_b
#one is opposite of the other (in direction) but actually they are
#doing the same thing, jus a stands for "start from top left cell" and
#b stands for "start from bottom right cell"




#this function create a cicle that interrupts only when i reach the and
#or a point were is not possible to continue

def from_beginning(fx,fy,maze,andata,step,cont):
    
    while fx == 0 and fy == 0:
        while cont != 0 and fx == 0 and fy == 0:
            
            cont,fx,fy = find_a(maze,andata,step)
            
        step +=1
        cont +=1
    return andata[len(maze)-1][len(maze[0])-1]


def from_end(fx,fy,maze,ritorno,step,cont):
    
    while fx == 0 and fy == 0:
        while cont != 0 and fx == 0 and fy == 0:
            
            cont,fx,fy = find_b(maze,ritorno,step)
            
        step +=1
        cont +=1
        
    return ritorno[0][0]

#this function is meant to search all the cells that contain the 
#number "n" and , if the same cell is a zero in the original matrix,
#pass them to an other function

def find_a (m,a,n):
    stop = 1
    
    for i in range (0,len(m)):
        for j in range (0,len(m[0])):
            
            if a[i][j] == n:
                stop = 0
                if m[i][j] == 0:
                    
                    pos_x,pos_y = write_near_a(a,i,j,n)
                    
                    if pos_x == 1 and pos_y == 1:
                        return n, pos_x, pos_y
                    
    if stop == 1:
        return 0,1,1
    else:
        return 0,0,0           
   

def find_b (m,b,n):
    stop = 1
    for i in range (len(m)-1,-1,-1):
        for j in range (len(m[0])-1,-1,-1):
            
            if b[i][j] == n:
                stop = 0
                if m[i][j] == 0:
                    
                    pos_x,pos_y = write_near_b(b,i,j,n)
                    
                    if pos_x == 1 and pos_y == 1:
                        return n, pos_x, pos_y
            
                    
    if stop == 1:
        return 0,1,1
    else:
        return 0,0,0
        
#in this function from the coordinates of a cell it serch for the cells 
#around it and if it is possible write the next step on it

def write_near_a(a,c_x,c_y,n):
    sal_x = c_x
    sal_y = c_y
    for p in range (-1,2):
        if c_x +p >=0 and c_x+p <= len(a)-1:
            if a[c_x+p][c_y] == 0:
                 a[c_x+p][c_y] = n+1
                
                 if c_x +p == len (a)-1:
                     sal_x =  c_x +p
                    
    for q in range (-1,2):
        if c_y +q >= 0 and c_y +q <= len(a[0])-1:
            if a[c_x][c_y+q] == 0:
                a[c_x][c_y+q] = n+1
                
                if c_y + q == len(a[0])-1:
                    sal_y = c_y +q
                        
    if sal_x == len(a)-1 and sal_y == len(a[0])-1:
        return 1,1
    else:
        return 0,0


def write_near_b(b,c_x,c_y,n):
    sal_x = c_x
    sal_y = c_y
    for p in range (-1,2):
        if c_x +p >=0 and c_x+p <= len(b)-1:
            if b[c_x+p][c_y] == 0:
                b[c_x+p][c_y] = n+1
                
                if c_x +p == 0:
                    sal_x =  c_x +p
                    
    for q in range (-1,2):
        if c_y +q >= 0 and c_y +q <= len(b[0])-1:
            if b[c_x][c_y+q] == 0:
                b[c_x][c_y+q] = n+1
                
                if c_y + q == 0:
                    sal_y = c_y +q
    
    if sal_x == 0 and sal_y == 0:
        return 1,1
    else:
        return 0,0

#with this function i implement the next passage of my algorithm:
#i find the shortest path by summing all the cells of the two matrix
#in couple and return the minimum value

def find_shortest_path(path_1,path_2):
    path =[]
    for i in range (len(path_1)):
        for j in range (len(path_1[0])):
            if path_1[i][j] != 0 and path_2[i][j] != 0:
                path.append(path_1[i][j]+path_2[i][j])
    short_path = min(path)
            
    return short_path-1


def answer(maze):

#creation of two matrix of the same dimension of maze, filled with zeroes

    andata = [[ 0 for y in range (len(maze[0]))] for x in range (len(maze))]
    ritorno = [[ 0 for y in range (len(maze[0]))] for x in range (len(maze))]
    
    fx = 0
    fy = 0
    step = 1
    cont = 1
    #the first cell of the matrix is initialized as 1 (the first step)
    andata[0][0] = step

#writing the matrix starting from top left cell

    from_beginning(fx,fy,maze,andata,step,cont)
    
    fx=0
    fy=0
    step=1
    cont=1
    #the last cell of the matrix is initialized as 1 (the first step)
    ritorno[len(maze)-1][len(maze[0])-1]= 1
   
#writing the matrix starting from bottom right cell
   
    from_end(fx,fy,maze,ritorno,step,cont)
   
#find the shortest path  
    shortest_path = find_shortest_path(andata,ritorno)

    #print(andata)

    return shortest_path


